import React from "react";
import { Container, Row, Col } from "react-bootstrap";
const GlobalFooter = () => {
	return (
		<footer className="bg-body-tertiary">
			<Container fluid>
				<Row
					className="d-flex align-items-center"
					style={{ fontSize: ".6rem" }}
				>
					<Col>
						<p className="align-self-start">
							Siyabonga B Soko
						</p>
					</Col>
				</Row>
			</Container>
		</footer>
	);
};

export default GlobalFooter;
